#include<iostream>#include<cmath>#include<vector>#define pb push_backusing namespace std;int main () {        vector<int> vc;    for(int i= 1; i < 10; ++i)        for(int j = 0; j < 10; ++j)            for(int k = 0; k < 10; ++k)                if(i*i*i + j*j*j + k*k*k == 100*i + 10*j + k)                    vc.pb(100*i + 10*j + k);        for (vector<int>::iterator it = vc.begin() ; it != vc.end() ; ++it)        cout << *it << " " ;    cout << endl;    }